import React, { Component } from 'react';
import { Link } from 'react-router-dom';

const style = {
    navbar: {
        height: '60px',
        width: '100%',
        backgroundColor: 'blue',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'flex-start',
        alignItems: 'flex-start',
        color: 'white'
    },
    logo: {
        height: '80%',
        width: '150px',
        backgroundColor: 'white',
        alignSelf: 'center',
        marginLeft: '20px'
    },
    navlink: {
        color: 'white',
        fontSize: '20px',
        alignSelf: 'center',
        margin: '10px'
    }



};

export class Navbar extends Component {
	render() {
		return(
            <div style={style.navbar}>
                <div style={style.logo}></div>
                <div style={style.navlink}><Link style={style.navlink} to="/home">Home</Link></div>
            </div>
        );
	}
}

export default Navbar;
